import React from 'react';

const TweetsList = ({tweets}) => ( 
    <div className="grid-container2">
        {tweets.map((thistweet, key) => (
            <>
            <div className="tweet" key={key}>
                <p>{thistweet.text}</p>
            </div> 
            {tweets.user.map((thisuser, key) =>
                <>
                <div key ={key}>
                    <p>{thisuser.name}</p>
                </div>
                </>
            )}
            </>
        ))}
        </div> 
)


export default TweetsList;
